import React from "react";

function BlogCard({ blog }) {
  return (
    <div className="blog-card">
      <h3>{blog.title}</h3>
      <p>{blog.content}</p>
      <span>✍️ {blog.author}</span>
      <small>{new Date(blog.date).toLocaleString()}</small>
    </div>
  );
}

export default BlogCard;
